import React from 'react';

function PostCard({post}){
    return(
        <div className = 'card'>
            <div className = 'container'>
                <h4><b>{post.title}</b></h4>
                <p>Author:{post.username}</p>
                <P>Data:{post.timeStamp}</P>
            </div>
        </div>
    )
}


export default PostCard;
